INSERT INTO `course` VALUES (1, '智能机器人系统', '智能，是人类得以脱胎于万灵的根本因素；人工智能，力图赋智能于机器，必将深刻改变人类文明进程。', 'http://edu-image.nosdn.127.net/B4839DBDE2346ADEAB71918D799EB73D.png?imageView&thumbnail=510y288&quality=100&type=webp', '', '肖浩军', 'http://127.0.0.1:8000/AIcourse/1', '12', '智能机器人系统是人工智能与机器人技术的完美结合。本课程将结合国防科技大学智能科学学院机器人研究中心的最新研究成果，以足球机器人、救援机器人、安保机器人等为教学案例，讲授智能机器人系统的基本原理和关键技术，包括机器人的机构与平台、运动控制、智能感知、导航定位、协同控制、人机交互等。', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/2/1.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/2/2.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/2/3.mp4', '智能机器人系统绪论', '智能机器人平台与系统', '机器人运动控制（上）', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/2/4.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/2/5.mp4', '机器人运动控制（下）', '机器人传感器', '2024-06-19 21:25:56', '2024-06-19 21:26:00', '2024-06-20 21:26:03', '2024-06-20 21:26:06', '2024-06-20 21:26:10', '[{\"liked\": 1, \"comment\": \"老师讲解的很清晰  我听得很舒服,感觉我又可以了\", \"student\": \"周涛\", \"progress\": 55, \"video_id\": 1, \"favorited\": 1}, {\"liked\": 1, \"comment\": \"老师的声音很有磁性，让人容易集中注意力\", \"student\": \"黄海\", \"progress\": 80, \"video_id\": 1, \"favorited\": 1}, {\"liked\": 1, \"comment\": \"课程设计得很好，很有条理\", \"student\": \"李婷\", \"progress\": 78, \"video_id\": 1, \"favorited\": 1}, {\"liked\": 1, \"comment\": \"实用性很强，帮助很大\", \"student\": \"胡海生\", \"progress\": 78, \"video_id\": 1, \"favorited\": 1}, {\"liked\": 1, \"comment\": \"讲解细致，内容充实\", \"student\": \"张婷雨\", \"progress\": 90, \"video_id\": 1, \"favorited\": 1}]', '[{\"liked\": 0, \"comment\": \"讲解速度太快，跟不上内容\", \"student\": \"周涛\", \"progress\": 50, \"video_id\": 2, \"favorited\": 0}, {\"liked\": 0, \"comment\": \"讲解速度太快，跟不上\", \"student\": \"黄海\", \"progress\": 45, \"video_id\": 2, \"favorited\": 0}, {\"liked\": 0, \"comment\": \"课程内容不够系统，缺乏深度\", \"student\": \"李婷\", \"progress\": 30, \"video_id\": 2, \"favorited\": 0}, {\"liked\": 0, \"comment\": \"课程有些枯燥，缺乏互动\", \"student\": \"胡海生\", \"progre