INSERT INTO `course` VALUES (2, '智能与信息社会', '讲解人工智能概念，机器学习，计算机视觉，语音技术，自然语言处理，自动驾驶，智能制造，量子计算等智能技术原理、实现及应用。', 'http://edu-image.nosdn.127.net/80411275619560C58048E59ACD3BF4BE.jpg?imageView&thumbnail=510y288&quality=100&type=webp', '', '郝兴伟', 'http://127.0.0.1:8000/AIcourse/2', '12', '近年来，物联网、大数据、云计算、人工智能技术快速发展，社会数字化进程加速，人类社会正在向智能时代迈进。在智能时代，各个学科与计算的结合越来越广泛，越来越深入，人工智能技术成为第四次科技革命和产业变革的核心技术。在各个领域，社会对了解和掌握人工智能技术的专业人才需求空前迫切。', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/3/1.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/3/2.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/3/3.mp4', '人工智能简述', 'AI漫谈', 'AI技术与典型应用案例', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/3/4.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/3/5.mp4', '人工智能和华为解决方案', '量子计算', '2024-06-19 21:25:56', '2024-06-19 21:26:00', '2024-06-20 21:26:03', '2024-06-20 21:26:06', '2024-06-20 21:26:10', '[{\"liked\": 1, \"comment\": \"这个视频真的帮助我理解了复杂的概念，讲解得非常清晰明了。\", \"student\": \"一号学生\", \"progress\": 15, \"video_id\": 1, \"favorited\": 0}, {\"liked\": 0, \"comment\": \"操了\", \"student\": \"二号学生\", \"progress\": 0, \"video_id\": 1, \"favorited\": 0}]', '[{\"liked\": 1, \"comment\": \"感谢老师提供的详细例子，让我能够更好地应用理论知识。\", \"student\": \"二号学生\", \"video_id\": 2, \"favorited\": 1}, {\"liked\": 1, \"comment\": \"感谢老师提供的详细例子，让我能够更好地应用理论知识。\", \"student\": \"一号学生\", \"progress\": 17, \"video_id\": 2, \"favorited\": 1}]', '[{\"liked\": 0, \"comment\": \"却在春去秋来时失去联络\", \"student\": \"二号学生\", \"video_id\": 3, \"favorited\": 1}, {\"liked\": 1, \"comment\": \"2.3\", \"student\": \"一号学生\", \"progress\": 25, \"video_id\": 3, \"favorited\": 1}]', '[{\"liked\": 1, \"comment\": \"是都\", \"student\": \"zhou\", \"video_id\": 4, \"favorited\": 1}]', '[{\"liked\": 1, \"comment\": \"555555555555555\", \"student\": \"zhou\", \"video_id\": 5, \"favorited\": 1}]', '[{\"test_1\": {\"score\": 0, \"test_id\": \"1\"}, \"test_3\": {\"score\": 0, \"test_id\": \"3\"}, \"student\": \"