INSERT INTO `course` VALUES (3, '人工智能原理', '在汹涌澎湃的科技创新大潮中，人工智能时代已经到来，准备好去拥抱这个时代了吗？那么，究竟什么是人工智能？人工智能研究什么？', 'http://edu-image.nosdn.127.net/F1CDF5E4C8EC3F8735B0D0BE763E02D1.jpg?imageView&thumbnail=510y288&quality=100&type=webp', 'https://www.bilibili.com/video/BV1KS411K71u/?spm_id_from=pageDriver&vd_source=2583d24e5d103c9e3a30a4f88bca0c79', '王文敏', 'http://127.0.0.1:8000/AIcourse/3', '33', '人工智能是国内外著名大学计算机专业设置的骨干课之一，也是国内外著名高校和研究机构的主要研究方向之一。人工智能研究如何用计算机软件和硬件去实现Agent的感知、决策与智能行为，其理论基础表现为搜索、推理、规划和学习，应用领域包括计算机视觉、图像分析、模式识别、专家系统、自动规划、智能搜索、计算机博弈、智能控制、机器人学、自然语言处理、社交网络、数据挖掘、虚拟现实等。', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/4/1.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/4/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%8E%9F%E7%90%86%5B%E5%8C%97%E4%BA%AC%E5%A4%A7%E5%AD%A6%C2%B7%E7%8E%8B%E6%96%87%E6%95%8F%5D%EF%BC%88%E4%B8%AD%E6%96%87%E6%95%99%E5%AD%A6%EF%BC%89%20-%2010.%5B3.1.1%5D--%E8%A7%86%E9%A2%91%EF%BC%9AProblemSolvingAgents%28Av837836460%2CP10%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/4/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%8E%9F%E7%90%86%5B%E5%8C%97%E4%BA%AC%E5%A4%A7%E5%AD%A6%C2%B7%E7%8E%8B%E6%96%87%E6%95%8F%5D%EF%BC%88%E4%B8%AD%E6%96%87%E6%95%99%E5%AD%A6%EF%BC%89%20-%2011.%5B3.2.1%5D--%E8%A7%86%E9%A2%91%EF%BC%9AExampleProblems%28Av837836460%2CP11%29.mp4', ' Introduction', ' Intelligent Agent', ' Rational Agents', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/4/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%8E%9F%E7%90%86%5B%E5%8C%97%E4%BA%AC%E5%A4%A7%E5%AD%A6%C2%B7%E7%8E%8B%E6%96%87%E6%95%8F%5D%EF%BC%88%E4%B8%AD%E6%96%87%E6%95%99%E5%AD%A6%EF%BC%89%20-%2012.%5B3.3.1%5D--%E8%A7%86%E9%A2%91%EF%BC%9ASearchingforSolutions%28Av837836460%2CP12%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/4/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%8E%9F%E7%90%86%5B%E5%8C%97%E4%BA%AC%E5%A4%A7%E5%AD%A6%C2%B7%E7%8E%8B%E6%96%87%E6%95%8F%5D%EF%BC%88%E4%B8%AD%E6%96%87%E6%95%99%E5%AD%A6%EF%BC%89%20-%2013.%5B3.4.1%5D--