INSERT INTO `course` VALUES (4, '云计算技术与应用', ' 我们身处云计算和大数据时代，已经在“云”端学习与生活。为了系统学习云计算技术，请加入“云计算技术与应用”课程吧！我们将带领你进入云中开启云计算之旅！', 'https://edu-image.nosdn.127.net/EEBB8E840E0598286E8238186730978C.jpg?imageView&thumbnail=426y240&quality=100', 'https://www.bilibili.com/video/BV1KS411K71u/?spm_id_from=pageDriver&vd_source=2583d24e5d103c9e3a30a4f88bca0c79', '吴飞', 'http://127.0.0.1:8000/AIcourse/4', '44', '云计算是继1980年代大型计算机到客户端-服务器的大转变之后信息技术领域又一次巨变。从技术上看,大数据与云计算的关系就像一枚硬币的正反面一样密不可分。大数据的特色在于对海量数据的挖掘, 但它必须依托云计算的分布式处理、分布式数据库、云存储和虚拟化技术。“云计算技术与应用”课程在介绍云计算历史、发展及趋势的基础上，重点介绍云计算关键技术、基础架构及各种主流解决方案。课程主要内容包括：云计算概述、云计算关键技术、云服务体系、云计算主流解决方案（Google云计算、Amazon云计算、阿里云计算等）、开源云计算与大数据处理平台（OpenStack、Docker、Hadoop等）。由于云计算是近年来计算机科学技术中的研究和应用热点，技术平台更新快，因此本课程会紧密跟踪主流云计算技术及发展，拓宽学生知识面。', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%AF%BC%E8%AE%BA/1.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%AF%BC%E8%AE%BA/2.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%AF%BC%E8%AE%BA/3.mp4', '云计算概论', '虚拟化技术', '阿里云虚拟化架构', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%AF%BC%E8%AE%BA/4.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%AF%BC%E8%AE%BA/5.mp4', '云服务', '云计算解决方案', '2024-07-08 12:37:19', '2024-07-08 12:37:21', '2024-07-08 12:37:22', '2024-07-08 12:37:25', '2024-07-08 12:37:26', NULL, NULL, NULL, NULL, NULL, NULL, 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%AF%BC%E8%AE%BA/6.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%AF%BC%E8%AE%BA/7.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%E5%AF%BC%E8%AE%BA/8.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/%E4%BA%BA%E5