INSERT INTO `course` VALUES (5, '深度学习及其应用', '不干涩地讲深层次理论和算法，也不是纯粹介绍TensorFlow的编程。而是针对大多数潜在学员的特点，通过针对典型的人工智能应用场景讲解TensorBoard可视化、模型的断点续训等实用技巧。', 'https://edu-image.nosdn.127.net/7DEAD21F6550D618BD3EEB66A7AA8B89.png?imageView&thumbnail=510y288&quality=100', 'https://www.bilibili.com/video/BV1KS411K71u/?spm_id_from=pageDriver&vd_source=2583d24e5d103c9e3a30a4f88bca0c79', '吴明晖', 'http://127.0.0.1:8000/AIcourse/5', '55', '本课程将主要内容根据学习阶段分为四部分：筑基篇、启航篇、进阶篇和扩展篇。筑基篇包括人工智能简介、开发环境搭建和Python开发语言快速入门、TensorFlow编程基础等三讲内容；启航篇从单个神经元的线性回归应用开始，直到完成多层神经网络应用开发，共有四讲内容；进阶篇主要围绕深度网络，从卷积神经网络CNN开始，历经循环神经网络RNN、生成对抗网络GAN等应用开发，涵括迁移学习等内容；扩展篇则包括Keras框架、TensorFlow.js、TensorFlow Lite移动应用开发等高级话题。', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/5/%E6%B7%B1%E5%BA%A6%E5%AD%A6%E4%B9%A0%E5%8F%8A%E5%85%B6%E5%BA%94%E7%94%A8-%E5%A4%8D%E6%97%A6%E5%A4%A7%E5%AD%A6%28%E7%B2%BE%E5%93%81%E8%AF%BE%29%20-%2012.1.4.1-%E9%93%B6%E8%A1%8C%E5%AE%A2%E6%88%B7%E6%B5%81%E5%A4%B1%E9%A2%84%E6%B5%8B1%28Av515628073%2CP12%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/5/%E6%B7%B1%E5%BA%A6%E5%AD%A6%E4%B9%A0%E5%8F%8A%E5%85%B6%E5%BA%94%E7%94%A8-%E5%A4%8D%E6%97%A6%E5%A4%A7%E5%AD%A6%28%E7%B2%BE%E5%93%81%E8%AF%BE%29%20-%201.1.1.1-%E7%A5%9E%E7%BB%8F%E7%BD%91%E7%BB%9C%E7%AE%80%E4%BB%8B%28Av515628073%2CP1%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/5/%E6%B7%B1%E5%BA%A6%E5%AD%A6%E4%B9%A0%E5%8F%8A%E5%85%B6%E5%BA%94%E7%94%A8-%E5%A4%8D%E6%97%A6%E5%A4%A7%E5%AD%A6%28%E7%B2%BE%E5%93%81%E8%AF%BE%29%20-%2010.1.3.12-BP%E7%BD%91%E7%BB%9C%E7%B2%BE%E8%AE%B25%28Av515628073%2CP10%29.mp4', '人工智能导论', '开发环境搭建', '简明Python基础', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/5/%E6%B7%B1%E5%BA%A6%E5%AD%A6%E4%B9%A0%E5%8F%8A%E5%85%B6%E5%BA%94%E7%94%A8-%E5%A4%8D%E6%97%A6%E5%A4%A7%E5%AD%A6%28%E7%B2%BE%E5%93%81%E8%AF%BE%29%20-%2011.1.3.13-BP%E7%BD%91%E7%BB%9C%E7%B2%BE%E8%AE%B26%28Av515628073%2CP11%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/5/%E6%B7%B1%E5%BA%A6%E5%AD%A6%E4%B9%