INSERT INTO `course` VALUES (6, '大数据算法', '大数据在不论在研究还是工程领域都是热点之一，算法是大数据管理与计算的核心主题。本课程试图简要介绍大数据计算中涉及到的基本算法设计方法。适用于大数据研究与开发人员，也适用于数据科学爱好者。', 'http://edu-image.nosdn.127.net/A8ABF0C2FADAFB40EE21CC75D54E6C18.png?imageView&thumbnail=510y288&quality=100&type=webp', 'https://www.bilibili.com/video/BV1KS411K71u/?spm_id_from=pageDriver&vd_source=2583d24e5d103c9e3a30a4f88bca0c79', '王宏志', 'http://127.0.0.1:8000/AIcourse/6', NULL, '大数据算法这门课程旨在通过讲授一些大数据上基本算法设计思想，包括概率算法、I/O有效算法和并行算法，让听课的同学们接触到和传统算法课程不一样的算法设计与分析思路，并且以最新的研究成果为导向，让参与这门课程学习的同学了解大数据算法的前沿知识。通过这门课程的学习，同学可以掌握大数据算法设计的基本思想，并通过本门课程的作业，掌握大数据算法设计与分析的技术。', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/6/%E5%93%88%E5%B0%94%E6%BB%A8%E5%B7%A5%E4%B8%9A%E5%A4%A7%E5%AD%A6-%E5%A4%A7%E6%95%B0%E6%8D%AE%E7%AE%97%E6%B3%95%EF%BC%88%E5%9B%BD%E5%AE%B6%E7%BA%A7%E7%B2%BE%E5%93%81%E8%AF%BE%EF%BC%89%20-%201.%5B1%5D--1.1%E5%A4%A7%E6%95%B0%E6%8D%AE%E7%9A%84%E5%AE%9A%E4%B9%89%E4%B8%8E%E7%89%B9%E7%82%B9%28Av70380828%2CP1%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/6/%E5%93%88%E5%B0%94%E6%BB%A8%E5%B7%A5%E4%B8%9A%E5%A4%A7%E5%AD%A6-%E5%A4%A7%E6%95%B0%E6%8D%AE%E7%AE%97%E6%B3%95%EF%BC%88%E5%9B%BD%E5%AE%B6%E7%BA%A7%E7%B2%BE%E5%93%81%E8%AF%BE%EF%BC%89%20-%2010.%5B1%5D--3.1%E6%95%B0%E6%8D%AE%E6%B5%81%E4%B8%AD%E9%A2%91%E7%B9%81%E5%85%83%E7%B4%A0-%E5%9F%BA%E7%A1%80%E7%9F%A5%E8%AF%86%28Av70380828%2CP10%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/6/%E5%93%88%E5%B0%94%E6%BB%A8%E5%B7%A5%E4%B8%9A%E5%A4%A7%E5%AD%A6-%E5%A4%A7%E6%95%B0%E6%8D%AE%E7%AE%97%E6%B3%95%EF%BC%88%E5%9B%BD%E5%AE%B6%E7%BA%A7%E7%B2%BE%E5%93%81%E8%AF%BE%EF%BC%89%20-%2011.%5B2%5D--3.1%E6%95%B0%E6%8D%AE%E6%B5%81%E4%B8%AD%E9%A2%91%E7%B9%81%E5%85%83%E7%B4%A0-%E7%AE%97%E6%B3%95%E4%B8%8E%E5%88%86%E6%9E%90%28Av70380828%2CP11%29.mp4', '大数据算法概述', '亚线性算法', '亚线性算法例析', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/6/%E5%93%88%E5%B0%94%E6%BB%A8%E5%B7%A5%E4%B8%9A%E5%A4%A7%E5%AD%A6-%E5%A4%A7%E6%95%B0%E6%8D%AE%E7%AE%97%E6%B3%95%EF%BC%88%E5