INSERT INTO `course` VALUES (7, '可持续智能城镇化', '课程由城市规划、人工智能、城市交通、城市管理、数据科学等专业背景的9位专家授课，重点讲授城镇化转型背景下智能城镇化与智能城市规划研究进展及创新技术方法的实践应用。', 'https://mooc-image.nosdn.127.net/b92f42ce1e0a401cbeb383cd3a7ee00a.jpg', 'https://www.bilibili.com/video/BV1KS411K71u/?spm_id_from=pageDriver&vd_source=2583d24e5d103c9e3a30a4f88bca0c79', '赖晓晨', 'http://127.0.0.1:8000/AIcourse/7', NULL, '本课程是规划领域全国首创以跨学科视角讲授可持续智能城镇化的在线前沿通识课，由中国工程院院士、德国工程科学院院士、瑞典皇家工程院院士、原同济大学副校长吴志强教授创立，同济大学建筑与城市规划学院副院长张尚武教授主持，旨在为城市规划及相关专业学生拓展学习可持续智能城镇化前沿知识提供开放共享资源。课程由城市规划、人工智能、城市交通、城市管理、数据科学等专业背景的9位专家授课，各位专家结合多年研究积累与实践经验，重点讲授城镇化转型背景下智能城镇化与智能城市规划研究进展及创新技术方法的实践应用， 使学生通过不同视角学习智能城镇化的可持续发展理念、前沿理论和最新实践案例，拓展跨学科认知和研究视角，激发协同创新研究潜能。\r\n', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/7/%E5%8F%AF%E6%8C%81%E7%BB%AD%E6%99%BA%E8%83%BD%E5%9F%8E%E9%95%87%E5%8C%96-%E5%90%8C%E6%B5%8E%E5%A4%A7%E5%AD%A6%20-%201.%5B1.1.1%5D--%E5%9F%8E%E5%B8%82%E5%8F%91%E5%B1%95%E4%B8%8E%E5%9F%8E%E9%95%87%E5%8C%96%E7%9A%84%E5%9F%BA%E6%9C%AC%E6%A6%82%E5%BF%B5%28Av591492396%2CP1%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/7/%E5%8F%AF%E6%8C%81%E7%BB%AD%E6%99%BA%E8%83%BD%E5%9F%8E%E9%95%87%E5%8C%96-%E5%90%8C%E6%B5%8E%E5%A4%A7%E5%AD%A6%20-%2010.%5B3.1.1%5D--%E6%99%BA%E6%85%A7%E5%9F%8E%E5%B8%82%E7%9A%84%E5%8F%91%E5%B1%95%E5%92%8C%E8%AE%A4%E8%AF%86%28Av591492396%2CP10%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/7/%E5%8F%AF%E6%8C%81%E7%BB%AD%E6%99%BA%E8%83%BD%E5%9F%8E%E9%95%87%E5%8C%96-%E5%90%8C%E6%B5%8E%E5%A4%A7%E5%AD%A6%20-%2011.%5B3.2.1%5D--%E6%99%BA%E6%85%A7%E5%9F%8E%E5%B8%82%E7%9A%84%E5%AE%9E%E8%B7%B5%E2%80%94%E6%A1%88%E4%BE%8B%E5%88%86%E6%9E%90%28Av591492396%2CP11%29.mp4', '城镇化、未来城市与智能规划', '城市发展与城镇化的基本概念', '世界各国的城镇化进程', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/7/%E5%8F%AF%E6%8C%81%E7%BB%AD%E6%99%BA%E8%83%BD%E5%9F%8E%E9%95%87%E5%8C%96-%E5%90%8C%E6%B5%8E%E5%A4%A7%E5%AD%A6%20-%2012.%5B3.3.1%5D--%E5%9B%BD%E5%86%85%E5%A4%96%E6%99%BA%E6%85%A7%E5%9F%8E%E5%B8%82%E8%A7%84%E5%88%92%E7%9A%84%E6%AF%9