INSERT INTO `course` VALUES (8, '模型与算法', '按照“厚基础、强交叉、养品行、促应用”的理念，从逻辑推理、搜索求解、监督学习、无监督学习、深度学习、强化学习和博弈对抗介绍人工智能基本概念和模型算法，好课！', 'https://edu-image.nosdn.127.net/729d3e37d2014e78a9bd1290b7dd8fe8.jpg', 'https://www.bilibili.com/video/BV1KS411K71u/?spm_id_from=pageDriver&vd_source=2583d24e5d103c9e3a30a4f88bca0c79', '谭志虎', 'http://127.0.0.1:8000/AIcourse/8', NULL, ' 人工智能(Artificial Intelligence，简称AI)是以机器为载体所展示出来的人类智能，因此人工智能也被称为机器智能(Machine Intelligence)。对人类智能的模拟可通过以符号主义为核心的逻辑推理、以问题求解为核心的探询搜索、以数据驱动为核心的机器学习、以行为主义为核心的强化学习和以博弈对抗为核心的决策智能等方法来实现。\r\n\r\n    本课程成体系介绍人工智能的基本概念和基础算法，可帮助学习者掌握人工智能脉络体系，体会具能、使能和赋能，从算法层面对人工智能技术“知其意，悟其理，守其则，践其行”。课程内容包括如下：人工智能概述、搜索求解、逻辑与推理、监督学习、无监督学习、深度学习、强化学习、博弈对抗。', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/8/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%EF%BC%9A%E6%A8%A1%E5%9E%8B%E4%B8%8E%E7%AE%97%E6%B3%95%20-%20%E6%B5%99%E6%B1%9F%E5%A4%A7%E5%AD%A6%20-%2010.4.1.1%204.1%E7%9F%A5%E8%AF%86%E5%9B%BE%E8%B0%B1%E6%8E%A8%E7%90%86%EF%BC%9A%E8%B7%AF%E5%BE%84%E6%8E%92%E5%BA%8F%E7%AE%97%E6%B3%95%28Av82428590%2CP10%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/8/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%EF%BC%9A%E6%A8%A1%E5%9E%8B%E4%B8%8E%E7%AE%97%E6%B3%95%20-%20%E6%B5%99%E6%B1%9F%E5%A4%A7%E5%AD%A6%20-%2011.4.2.1%204.2%20%E5%9B%A0%E6%9E%9C%E6%8E%A8%E7%90%86%28Av82428590%2CP11%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/8/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%EF%BC%9A%E6%A8%A1%E5%9E%8B%E4%B8%8E%E7%AE%97%E6%B3%95%20-%20%E6%B5%99%E6%B1%9F%E5%A4%A7%E5%AD%A6%20-%2012.5.1.1%205.1%20%E6%9C%BA%E5%99%A8%E5%AD%A6%E4%B9%A0%E5%9F%BA%E6%9C%AC%E6%A6%82%E5%BF%B5%28Av82428590%2CP12%29.mp4', 'GPT 和ChatGPT看AI发展', '可计算思想起源与发展', ' 人工智能的发展简史', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/8/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD%EF%BC%9A%E6%A8%A1%E5%9E%8B%E4%B8%8E%E7%AE%97%E6%B3%95%20-%20%E6%B5%99%E6%B1%9F%E5%A4%A7%E5%AD%A6%20-%2013.5.2.1%205.2%20%E7%BA%BF%E6%80%A7%E5%9B%9E%E5%BD%92%E5%88%86%E6%9E%90%28Av82428590%2CP13%29.mp4', 'h