算法（boosting）', '2024-07-08 16:22:56', '2024-07-08 16:22:57', '2024-07-08 16:22:57', '2024-07-08 16:22:57', '2024-07-08 16:22:58', '2024-07-08 16:22:59', '2024-07-08 16:22:59', '2024-07-08 16:23:00', '2024-07-08 16:23:00', '2024-07-08 16:23:01', '2024-07-08 16:23:01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `course` VALUES (9, '可视化导论', '人类处理数据的能力已远远落后于获取数据的能力。提高数据处理效率的关键途径是是通过有效的可视方法，将人的智能和个性化经验融入到机器智能分析和推理决策过程中。', 'http://edu-image.nosdn.127.net/77FC406D5E268260FEBCF59C0A3BA063.png?imageView&thumbnail=510y288&quality=100&type=webp', 'https://www.bilibili.com/video/BV1KS411K71u/?spm_id_from=pageDriver&vd_source=2583d24e5d103c9e3a30a4f88bca0c79', '刘彪', 'http://127.0.0.1:8000/AIcourse/9', NULL, '数据的采集、提取和理解是人类感知和认识世界的基本途径之一，数据可视化为人类洞察数据的内涵、理解数据蕴藏的规律提供了重要的手段。\r\n\r\n\r\n\r\n随着数据时代的来临，大数据的分析、挖掘与可视化已经成为信息技术发展的迫切需求。\r\n\r\n\r\n\r\n面对当前科学可视化、信息可视化、可视分析研究和应用的新形势，需要发展新的复杂数据的处理、分析与可视化方法，并围绕实际科学和社会问题的求解设计高效的人机交互界面。\r\n\r\n\r\n\r\n可视分析学是一门以视觉感知增强认知为目标、以视觉理解和机器理解为对偶手段、以可视界面为信息交流通道的综合性学科。在因时、因地、临场、应急、博弈等分析决策的关键场合中，可视分析的作用尤为重要。特别地，大数据可视分析在宏观、概览、关联、隐性表达等方面具有不可替代的效应。\r\n\r\n\r\n\r\n本课程将以归纳介绍核心的数据可视化原理为主，覆盖最重要、最基础的数据可视化知识点。\r\n\r\n\r\n\r\n全课程共15章，可划分为三个模块：基础篇、数据篇和应用篇。其中基础篇从人、数据、可视化流程等三个层面阐述数据可视化的基础理论和概念。数据篇则针对实际应用中遇到的不同类型的数据，包括时空数据，地理信息数据、高维非空间数据、层次和网络数据，介绍相应的可视化方法。应用篇着重介绍可视化工具及应用实例。\r\n\r\n\r\n\r\n本课程将为本科高年级同学、研究生初学者从可视化的角度提供新的数据理解手段，同时可为相关数据处理、艺术设计人员提供科普性知识。', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/9/%E3%80%90%E5%8F%AF%E8%A7%86%E5%8C%96%E5%AF%BC%E8%AE%BA%E3%80%91%20%20%20%E6%B5%99%E6%B1%9F%E5%A4%A7%E5%AD%A6%20%20%20%E9%99%88%E4%B8%BA%E6%95%99%E6%8E%88%20-%201.1.1%20%E5%8F%AF%E8%A7%86%E5%8C%96%E5%88%9D%E8%AF%86%28Av957627167%2CP1%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/9/%E3%80%90%E5%8F%AF%E8%A7%86%E5%8C%96%E5%AF%BC%E8%AE%BA%E3%80%91%20%20%20%E6%B5%99%E6%B1%9F%E5%A4%A7%E5%AD%A6%20%20%20%E9%99%88%E4%B8%BA%E6%95%99%E6%8E%88%20-%2010.4.1%20%E5%8F%AF%E8%A7%86%E5%8C%96%E5%9F%BA%E6%9C%AC%E6%B5%81%E7%A8%8B%E5%88%9D%E6%8E%A2%28Av957627167%2CP10%29.mp4', 'https://rengongzhinengcourse.oss-cn-hangzhou.aliyuncs.com/9/%E3%80%90%E5%8F%AF%E8%A7%86%E5%8C%96%E5%AF%BC%E8%AE%BA%E3%80%91%20%20%20%E6%B5%99%E6%B1%9F%E5%A4%A7%E5%AD%A6%20%20%20%E9%99%88%E4%B8%BA%E6%95%99%E6%8E%88%20-%2011.4.2%20%E6%95%B0%E6%8D%AE%E5%8F%AF%E8%A7%86%E5%8C%96%E7%9A%84%E