INSERT INTO `individual_timu` VALUES (2, 'A', '{\"A\": \"线性回归\", \"B\": \"K-means\", \"C\": \"卷积神经网络 (CNN)\", \"D\": \"支持向量机 (SVM)\", \"title\": \"在监督学习中，下列哪个算法最适合用于分类问题？\"}', '{\"A\": \"Sigmoid\", \"B\": \"ReLU (Rectified Linear Unit)\", \"C\": \"Softmax\", \"D\": \"所有选项都是\", \"title\": \"下列哪一项是深度学习中常用的激活函数？\"}', '{\"A\": \"Word2Vec\", \"B\": \"RNN (Recurrent Neural Network)\", \"C\": \"CNN (Convolutional Neural Network)\", \"D\": \"LSTM (Long Short-Term Memory)\", \"title\": \"在自然语言处理中，用于词向量嵌入的技术是什么？\"}', '{\"A\": \"K-means\", \"B\": \"AdaBoost\", \"C\": \"Gradient Boosting\", \"D\": \"Random Forest\", \"title\": \"哪种算法常被用于无监督学习中的聚类任务？\"}', '{\"A\": \"YOLO (You Only Look Once)\", \"B\": \"SVM (Support Vector Machine)\", \"C\": \"PCA (Principal Component Analysis)\", \"D\": \"Naive Bayes\", \"title\": \"在计算机视觉中，用于目标检测的算法是什么？\"}', '{\"A\": \"监督学习\", \"B\": \"非监督学习\", \"C\": \"半监督学习\", \"D\": \"加强学习\", \"title\": \"强化学习中的Q-learning属于哪种类型的学习？\"}', '{\"A\": \"特征选择\", \"B\": \"模型训练\", \"C\": \"模型评估\", \"D\": \"结果解释\", \"title\": \"数据挖掘过程中，下列哪一项是预处理步骤？\"}', '{\"A\": \"过采样\", \"B\": \"降维\", \"C\": \"主成分分析\", \"D\": \"K-means\", \"title\": \"下列哪种技术可用于处理不平衡的数据集？\"}', '{\"A\": \"Dropout\", \"B\": \"Batch Normalization\", \"C\": \"L1 正则化\", \"D\": \"所有选项都是\", \"title\": \"在深度学习中，防止过拟合的一种策略是什么？\"}', '{\"A\": \"文本分类\", \"B\": \"机器翻译\", \"C\": \"情感分析\", \"D\": \"命名实体识别\", \"title\": \"NLP中的序列到序列模型（Seq2Seq）主要用于什么任务？\"}', '{\"title\": \"在机器学习中，_________交叉验证是一种评估模型泛化能力的方法.\"}', '{\"title\": \"深度学习的_反向传播________算法用于更新神经网络中的权重.\"}', '{\"title\": \"在NLP中 ,________是一种衡量词在文档中重要性的指标.\"}', '{\"title\": \"计算机视觉中的________算法用于特征检测和匹配.\"}', '{\"title\": \"强化学习的两个主要组成部分是__________和__________.\"}', '{\"title\": \"数据挖掘的目标之一是发现数据中的________和趋势.\"}', '{\"title\": \"在监督学习中，特征工程的目的是__________.\"}', '{\"title\": \"无监督学习中，主成分分析(PCA)用于降维.\"}', '{\"title\": \"在处理文本数据时，_______模型忽略了单词顺序.\"}', '{\"title\": \"对于强化学习，_________函数指导智能体采取行动.\"}', '{\"title\": \"给定一个二元分类问题，使用逻辑回归模型，假设阈值为0.5，预测概率为0.65，请判断该样本的分类标签.\"}', '{\"title\": \"设计一个简单的深度学习模型，用于手写数字识别，包括网络架构和损失函数的选择.\"}', '{\"title\": \"使用TF-IDF计算给定文档集中关键词的权重.\"}', '{\"title\": \"给定一组图像数据，使用K-means算法进行聚类，确定最佳的聚类数量.\"}', '{\"title\": \"在一个强化学习环境中，计算基于Q-learning策略下智能体获得的最大累积奖励.\"}', '《人工智能基础理论检测卷》');
INSERT INTO `individual_timu` VALUES (3, 'B', '{\"A\": \"决策树\", \"B\": \"K-means\", \"C\": \"逻辑回归\", \"D\": \"PCA\", \"title\": \"在监督学习中，用于分类问题的常见算法是（）.\"}', '{\"A\": \"可以处理非线性关系\", \"B\": \"容易导致梯度消失\", \"C\": \"输出范围无限\", \"D\": \"在所有情况下都优于Sigmoid函数\", \"title\": \"深度学习中，激活函数ReLU的特点是（）.\"}', '{\"A\": \"LSTM\", \"B\": \"Word2Vec\", \"C\": \"CNN\", \"D\": \"SVM\", \"title\": \"自然语言处理中，用于词向量表示的经典模型是（）.\"}', '{\"A\": \"ResNet\", \"B\": \"DBSCAN\", \"C\": \"Naive Bayes\", \"D\": \"KNN\", \"title\": \"在计算机视觉中，用于特征提取的网络是（）.\"}', '{\"A\": \"状态-动作对\", \"B\": \"词袋模型\", \"C\": \"卷积层\", \"D\": \"主成分分析\", \"title\": \"强化学习的核心概念之一是（）.\"}', '{\"A\": \"逻辑回归\", \"B\": \"决策树\", \"C\": \"K-means\", \"D\": \"均值填充\", \"title\": \"数据挖掘中，用于处理缺失值的常见方法是（）.\"}', '{\"A\": \"GAN\", \"B\": \"AdaBoost\", \"C\": \"K-means\", \"D\": \"Gradient Descent\", \"title\": \"非监督学习中，用于聚类的算法是（）.\"}', '{\"A\": \"词频\", \"B\": \"精确度\", \"C\": \"卷积核大小\", \"D\": \"学习率\", \"title\": \"监督学习中，评估模型性能的常用指标是（）.\"}', '{\"A\": \"SVM\", \"B\": \"RNN\", \"C\": \"KNN\", \"D\": \"PCA\", \"title\": \"在NLP中，用于序列生成的模型是（）.\"}', '{\"A\": \"特征选择\", \"B\": \"模型训练\", \"C\": \"模型评估\", \"D\": \"结果解释\", \"title\": \"数据预处理的一个重要步骤是（）.\"}', '{\"title\": \"在深度学习中，________算法用于更新神经网络的权重.\"}', '{\"title\": \"NLP中，TF-IDF是用来衡量词在文档中的________.\"}', '{\"title\": \"强化学习的两个基本组件是________和________.\"}', '{\"title\": \"数据挖掘的目标之一是发现数据中的________和趋势.\"}', '{\"title\": \"无监督学习中，PCA用于________.\"}', '{\"title\": \"在处理文本数据时，________忽略了单词的顺序.\"}', '{\"title\": \"对于强化学习，________函数指导智能体的行为.\"}', '{\"title\": \"在监督学习中，特征工程的目的是________.\"}', '{\"title\": \"计算机视觉中，________用于目标检测.\"}', '{\"title\": \"深度学习中，防止过拟合的策略之一是________.\"}', '{\"title\": \"假设使用逻辑回归模型预测一个二元分类问题，给定阈值为0.5，预测概率为0.65，请判断该样本的分类标签.\"}', '{\"title\": \"假设有一个包含1000个样本的不平衡数据集，其中正例占10%，请设计一种过采样的方法，并计算过采样后的正例样本数量.\"}', '{\"title\": \"在一个简单的深度学习模型中，用于手写数字识别，包括一个输入层、两个隐藏层和一个输出层。假设输入层接收28x28像素的图像，每个隐藏层有128个节点，输出层有10个节点。计算模型的总参数数量.\"}', '{\"title\": \"使用K-means算法对一组图像数据进行聚类，假设图像数据经过预处理后被转换为固定长度的特征向量。给定数据集，如何确定最佳的聚类数量.\"}', '{\"title\": \"在一个强化学习环境中，智能体遵循Q-learning策略，给定特定的奖励函数，计算智能体在某个状态下采取最优行动所能获得的最大累积奖励.\"}', '《人工智能基础综合试卷》');
